import App from './components/App';
import { 
    BrowserRouter as Router,
    Switch, 
    Route, 
    Link
} from "react-router-dom";

function DropInMenu() {
    return (
        <Router>
            <div id="menu">
                <Link to="/"><p className="menuItem">Recommender</p></Link> 
                <p className="menuItem">Statistics</p>     
                <p className="menuItem">Players</p>    
                <p className="menuItem">Contact</p>            
            </div>
        </Router>
    )
};

export default DropInMenu;
